import React from 'react';
import {DeleteBook, EditBook } from '../../actions/index';
const DataRowItem=({book,onEditClick,onDeleteClick})=>{  
    console.log("DataRowItem Component ",book)
    const {value}=book.id;
    return (                            
            <tr key={book.id}>
                {/* <td>{this.props.books.length}</td> */}
                <td>{book.booktitle}</td>
                <td>{book.cover}</td>
                <td>{book.author}</td>
                <td>{book.publisher}</td>       
                <td>  <button onClick={(e) => onEditClick(e.target.value)}>Edit</button><button onClick={(e) =>onDeleteClick(e.target.value)} className="btn btn-danger">Delete</button></td>
            </tr>
        
        
    )
}

export default DataRowItem;
